script: |
  super -f text -I q8571.spq | sort > q8571.out

inputs:
  - name: q8571.spq
    data: |
      SELECT DISTINCT col2 * - 65 + + + 48 * col2 + CAST ( + 56 AS INTEGER ), col0 / - col0 AS col1 FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN + + col0 AND col2;
  - name: tab0

outputs:
  - name: q8571.out
    data: |
